function updateAnswers() {
  if (($('.question-answers').length)) {
    var question_id;
    question_id = $('.question-answers').data('questionId')

    App.cable.subscriptions.create('AnswersChannel', {
      connected: function () {
        this.perform('follow', {
          question_id: question_id
        })
      },
      received: function (data) {
        $('#question_' + question_id + '_answers').append(data)
        voteAnswer();
        editAnswer();
      }
    })
  } else if (App.answers) {
    App.answers.unsubscribe();
    App.answers = null;
  }
}

function updateComments() {
  if (($('.question-answers').length)) {
    var question_id;
    question_id = $('.question-answers').data('questionId')

    App.comments = App.cable.subscriptions.create(
      "CommentsChannel", {
        connected: function () {
          this.perform('follow', {
            question_id: question_id
          })
        },
        received: function (data) {
          switch (data.type) {
            case 'Question':
              $('.question-comments').append(data.html);
              break;
            case 'Answer':
              $('.answer-comments-' + data.id).append(data.html);
              break;
          }
        }
      });
  } else if (App.comments) {
    App.comments.unsubscribe();
    App.comments = null;
  }
}

$(document).on('turbolinks:load', function () {
  editAnswer();
  voteAnswer();
  updateAnswers();
  updateComments();
})
